import React from 'react';
import { Routes, Route, BrowserRouter } from 'react-router-dom'; // Importing Routes and Route
import Navbar from './components/Navbar/navbar';
import Footer from './components/footer/footer';
import Home from './pages/home/home';
import Services from './pages/service/service'; // Changed 'Service' to 'Services' for consistency

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/service" element={<Services />} /> {/* Changed 'Service' to 'Services' */}
        </Routes>

        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
